import React from "react";
import "./App.css";
import { useState } from "react";
const App = () => {
  return (
    <div className="app">
      <h1>{count}</h1>
      <button onClick={less}>-</button>
      <button onClick={add}>+</button>
    </div>
  );
};
export default App;
